print("Pearson Correlation Coefficient:", corr_coef)

# Now, let's bin the Q values into 10 equal-width bins.
n_bins = 10
bins = np.linspace(q_values.min(), q_values.max(), n_bins + 1)
bin_indices = np.digitize(q_values, bins)

# Calculate the center of each bin:
bin_centers = (bins[:-1] + bins[1:]) / 2

# For each bin, compute the average entropy:
avg_entropy_per_bin = [
    entropies[bin_indices == i].mean() if np.any(bin_indices == i) else np.nan
    for i in range(1, n_bins + 1)
]

print("Bin centers (Q values):", bin_centers)
print("Average Entropy per bin:", avg_entropy_per_bin)

